INSERT INTO `products` VALUES (1,1,1,'Notebook Lenovo AMD Ryzen 5-3500U 8GB 1TB Tela 15.6” Windows 10 Ideapad S145 81V70004BR','O notebook Lenovo Ideapad S145 possui um design sofisticado leve e compacto, com tela antirreflexo de 15.6\" para mais conforto visual e definição de imagem.',3799,'2021-08-21 21:15:51'),(2,1,2,'Notebook Acer Core i3-1005G1 8GB 512GB SSD Tela 15.6” Windows 10 Aspire 3 A315-56-35ET','O notebook Acer Aspire 3 A315 foi desenvolvido para não deixar você parar.',3499,'2021-08-21 21:21:37'),(3,1,3,'Notebook Samsung Dual Core 4GB 64GB SSD Tela Full HD 13.3” Windows 10 Flash F30 NP530XBB-AD1BR','O notebook Flash Samsung é a escolha ideal para quem possui uma rotina agitada e passa o dia em movimento. Seu design inovador oferece portabilidade e estilo através de uma estrutura fina, leve e com acabamento diferenciado.',2621,'2021-08-21 21:25:31'),(4,1,3,'Notebook Samsung Dual Core 4GB 500GB Tela 15.6\" Windows 10 Book E20 NP550XCJ-KO1BR','O Samsung Book foi desenvolvido para quem busca um notebook de alta qualidade, com design elegante e detalhes que surpreendem.',3024,'2021-08-22 16:42:04'),(5,1,2,'Notebook Gamer Acer NVIDIA GeForce GTX 1650 Core i5-9300H 8GB 1TB 128GB SSD Tela Full HD 15.6\" Windows 10 Aspire Nitro 5 AN515-54-528','Com um belíssimo design, desenvolvido na tonalidade preta, o Notebook Acer AN515-54-528V chegou para proporcionar muito mais agilidade, simplicidade e alto desempenho à execução de suas tarefas profissionais e pessoais.',5799,'2021-08-22 16:44:48'),(6,1,4,'Notebook Gamer Dell G3 3500-U10P 15.6\" 10ª Geração Intel Core i5 8GB 256GB SSD NVIDIA GTX 1650 Linux','SUA EXPERIÊNCIA GAMER AINDA MAIS INTENSA E REAL: GRÁFICOS PODEROSOS, DESEMPENHO EXTREMAMENTE RÁPIDO E SISTEMA TÉRMICO ESPECIAL.',5323,'2021-08-22 16:47:21'),(7,1,5,'Notebook Asus Core i7- 8565U 8GB 1TB Tela 15,6\" Endless OS X512FJ-EJ227 – Cinza','Seja para trabalhar ou para se divertir, ASUS VivoBook 15 é o notebook ideal para se concentrar. Tela quase com bordas ultrafinas, ergonômico e eficiente, compacto, fino e leve.',5699,'2021-08-22 16:48:57'),(8,1,2,'Notebook Acer Aspire 3 A315-42G-R1FT AMD Ryzen 7 8GB 256GB SSD Radeon 540X 15,6` Windows 10','Notebook Acer Aspire 3 A315-42G-R1FT AMD Ryzen 7 8GB 256GB SSD Radeon 540X 15,6\' Windows 10',4999,'2021-08-22 16:50:21'),(9,1,3,'Notebook Samsung Dual Core 4GB 64GB SSD Tela Full HD 13.3” Windows 10 Flash F30 NP530XBB-AD3BR','O notebook Flash Samsung é a escolha ideal para quem possui uma rotina agitada e passa o dia em movimento. Seu design inovador oferece portabilidade e estilo através de uma estrutura fina, leve e com acabamento diferenciado.',2599,'2021-08-22 16:52:05'),(10,1,5,'Notebook Asus RYZEN 5 3500U 8GB 1TB Tela 15,6\" Windows 10 Home M509DA-BR324T – Cinza Escuro','Com um belíssimo design, desenvolvido na tonalidade cinza, o Notebook Notebook Asus M509DA-BR324T chegou para proporcionar muito mais agilidade, simplicidade e alto desempenho à execução de suas tarefas profissionais e pessoais.',3899,'2021-08-22 16:55:01'),(11,1,6,'Notebook Vaio Core i5-10210U 8GB 1TB Tela 14’’ Linux FE14 VJFE42F11X-B0451H','Com o Notebook Vaio FE14 você terá portabilidade, desempenho e conectividade para acompanhar o seu dia a dia.',3799,'2021-08-22 16:59:55'),(12,1,7,'Notebook 2 em 1 Positivo Dual Core 4GB 64GB eMMC Tela Full HD 11.6\" Windows 10 Duo C464C','O notebook 2 em 1 Positivo Duo C464C oferece uma nova experiência de trabalho e diversão, com a versatilidade que você precisa para acompanhar a sua rotina.',1749,'2021-08-22 17:02:27'),(13,1,3,'Notebook Gamer Samsung NVIDIA GeForce GTX 1650 Core i5-9300H 8GB 1TB Tela Full HD 15.6” Windows 10 Odyssey NP850XBD-XG1BR','Alta performance e vitórias combinam com o notebook Samsung Odyssey Gamer.',7499,'2021-08-22 17:05:11'),(14,1,6,'Notebook VAIO Core i7-10510U 8GB 1TB Tela 15.6” Windows 10 FE15 VJFE5211X-B0211H','O VAIO FE15 possui uma tela de alta resolução com moldura reduzida, ou seja, reduzimos o tamanho das bordas laterais do noteboo